import React from 'react';
import { Box, Typography, Button, Grid, Card, CardMedia, CardContent, Fade } from '@mui/material';
import { styled } from '@mui/system';
import { useNavigate } from 'react-router-dom';
import backgroundImage from '../assets/home.jpg'; // Hero background

// Styled Hero Section
const HeroSection = styled(Box)({
  height: '80vh',
  backgroundImage: `url(${backgroundImage})`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#ffffff',
  textAlign: 'center',
  position: 'relative',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    backgroundColor: 'rgba(0, 0, 0, 0.5)',
    zIndex: 1,
  },
});

const HeroContent = styled(Box)({
  zIndex: 2,
});

const StyledButton = styled(Button)({
  backgroundColor: '#28b463',
  color: '#ffffff',
  padding: '12px 40px',
  fontSize: '18px',
  fontWeight: 'bold',
  borderRadius: '5px',
  '&:hover': {
    backgroundColor: '#229954',
  },
});

const SectionTitle = styled(Typography)({
  fontWeight: 'bold',
  color: '#000000',
  marginBottom: '30px',
  textAlign: 'center',
});

const ProductCard = styled(Card)({
  transition: 'transform 0.3s ease',
  '&:hover': {
    transform: 'scale(1.05)',
  },
});

const Home = () => {
  const navigate = useNavigate();

  const featuredProducts = [
    { id: 1, name: 'Oversized Black Tee', price: '₹999', image: 'https://via.placeholder.com/300x400' },
    { id: 2, name: 'Oversized White Tee', price: '₹999', image: 'https://via.placeholder.com/300x400' },
    { id: 3, name: 'Oversized Green Tee', price: '₹1099', image: 'https://via.placeholder.com/300x400' },
  ];

  return (
    <Box sx={{ flexGrow: 1 }}>
      {/* Hero Section */}
      <HeroSection>
        <HeroContent>
          <Fade in timeout={1000}>
            <Typography variant="h2" sx={{ fontWeight: 'bold', mb: 2 }}>
              Discover Premium Oversized Tees
            </Typography>
          </Fade>
          <Fade in timeout={1500}>
            <Typography variant="h5" sx={{ mb: 4 }}>
              Comfort Meets Style at Baa M Boo
            </Typography>
          </Fade>
          <Fade in timeout={2000}>
            <StyledButton onClick={() => navigate('/shop')}>
              Shop Now
            </StyledButton>
          </Fade>
        </HeroContent>
      </HeroSection>

      {/* Featured Products Section */}
      <Box sx={{ py: 8, px: 4 }}>
        <SectionTitle variant="h4">Featured Products</SectionTitle>
        <Grid container spacing={4} justifyContent="center">
          {featuredProducts.map((product) => (
            <Grid item xs={12} sm={6} md={4} key={product.id}>
              <Fade in timeout={1000}>
                <ProductCard>
                  <CardMedia
                    component="img"
                    height="400"
                    image={product.image}
                    alt={product.name}
                  />
                  <CardContent>
                    <Typography variant="h6">{product.name}</Typography>
                    <Typography variant="body1" color="text.secondary">
                      {product.price}
                    </Typography>
                    <Button variant="outlined" sx={{ mt: 2 }}>
                      Add to Cart
                    </Button>
                  </CardContent>
                </ProductCard>
              </Fade>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* CTA Section */}
      <Box sx={{ py: 6, backgroundColor: '#f5f5f5', textAlign: 'center' }}>
        <Typography variant="h4" sx={{ mb: 2 }}>
          Join the Baa M Boo Community
        </Typography>
        <Typography variant="body1" sx={{ mb: 3 }}>
          Get exclusive offers and updates by subscribing to our newsletter.
        </Typography>
        <StyledButton>Subscribe Now</StyledButton>
      </Box>
    </Box>
  );
};

export default Home;
